INSERT INTO `pages` VALUES (2,'Sandra Kuhlmann','<p></p><p></p><h1><span style=\"&quot;color:;\">Meine Person</span></h1><p><span style=\"&quot;color:;\">Mein Name ist Sandra Kuhlmann und ich bin 1965 in Bern geboren. Seit meiner Kindheit habe ich die Freude an der Bewegung nie verloren, damals als Eiskunstläuferin, später im Tanz oder Theater. Dem Körper seelischen Ausdruck verleihen zu können, hat mich immer schon durchwärmt und erfreut.</span><br><span style=\"&quot;color:;\">Das Leben hat mir noch andere Aufgaben gestellt. Wesentlicher Teil ist und war meine Familie, mein Mann und unsere fünf Kinder. Dazu bauten mein Mann und ich eine sozialpädagogische Institution mit einer Demeter Landwirtschaft im Emmental auf, Sothegra.</span><br><span style=\"&quot;color:;\">All die Erfahrungen, die ich machen durfte, führten mich eines Tages zum Yoga. In der Tapas Yoga- Schule in Kehrsatz begann ich eine vierjährige Ausbildung zur Yoga- Lehrerin der Yoga Schweiz, YCH.</span></p><p></p><h1><span style=\"&quot;color:;\">Diplome und Zertifikate</span></h1><p><span style=\"&quot;font-family:;\">2017</span><span style=\"&quot;color:;\">: Diplom zur diplomierten Yogalehrerin der Yoga Schweiz, YCH,  und der Europäischen Yoga- Union, EYU.  Ruth Westhauser, Tapas Yogaschule Bern.</span></p><p><span style=\"&quot;font-family:;\">2019</span><span style=\"&quot;color:;\">: Zertifikat Yoga in der Schwangerschaft und Rückbildung, Ursula Salbert, Yoga Carmen Bern</span></p><p><span style=\"&quot;font-family:;\">2017-2019</span><span style=\"&quot;color:;\">: Svastha Yoga and Ayurveda of Krishnamacharya Therapie Programm, Modul 1-6 in Bern, Ganesh Mohan und Dr. Günter Nissen, Berlin</span></p>','sandra-kuhlmann','pages/SIJRXzHckldRSCU20FsLxWLDMHeRW0dGDY9jHRqn.jpeg',NULL,'2019-06-21 13:35:03','2025-02-09 16:33:29'),(3,'Yoga','<p></p><p></p><h1><span style=\"&quot;color:;\">Was ist Yoga?</span></h1><p><span style=\"&quot;color:;\">Yoga ist ein ganzheitlicher, hinduistisch geprägter Übungsweg für die Seele, den Geist und den Körper. Jedes Asana (Übungspraxis) ist neben der körperlichen Kräftigung, ein innerer kreativer Prozess, der uns neue Dimensionen eröffnen kann. Heute kennen wir im Westen vor allem den Hatha-Yoga, der uns den Weg der inneren Erleuchtung weist. Mit ethischen Handlungsansätzen, täglicher Übungspraxis- Asana, Atemübungen- Pranayama - Übungen zur Beruhigung und Reinigung auf mentaler und energetischen Ebene, führt uns der Hatha- Yoga in die Stille zur Konzentrationsfähigkeit. Hier beginnt der Übergang zur Meditation, zu unserem Selbst. Diesen Schulungsweg finden wir in den verschiedenen Yogaschulen: z.B. Patanjali Yoga Sutra beinhaltet der achtfache Pfad, auch als Spiegel der Seele genannt; In der Bhagavad Gita, wird der Bakthi Marga als der Yoga Weg der Hingabe dargestellt. Die verschiedenen Yogaschulen haben sich in der Entstehungsgeschichte gegenseitig geprägt und beeinflusst.</span></p><p></p><h1><span style=\"&quot;color:;\">Gesundheit</span></h1><p><span style=\"&quot;color:;\">Heutzutage ist der Yoga immer noch oder gerade wieder aktuell. In der modernen Zeit, in welcher wir ständig gefordert oder sogar gestresst uns fühlen, kann Yoga uns helfen, innere Ruhe zu erlangen. Täglich kurze Zeit sich selber zu gönnen, fördert unsere Gesundheit und Ausgeglichenheit, daraus kann Wohlbefinden und Zufriedenheit entstehen. Die Körperübungen, Asana helfen unseren oft einseitig belasteten Körper auszugleichen: mit Aufrichtung, Lockerung, Dehnungen und Kräftigung der Muskulatur und Balanceübungen. Durch die Körperarbeit erreichen wir mehr Stabilität und zugleich Leichtigkeit: Sthiram Sukham Asana, PYS. 2,6. Die Atemübungen, Pranayama führen uns mit der Konzentration auf den Atem, in die Stille und schenken uns Ruhe und Gelassenheit. Der Energiehaushalt wird gereinigt und harmonisiert. Sind die Gedanken durch die Konzentration auf den Atem unter Kontrolle, erweitert sich das Bewusstsein. In der Meditation kann der Übende die Verbindung zu seinem Selbst neu erfahren und sich mit der Einheit verbinden. Diese Erfahrungen ermöglichen uns, die Lebenshaltung positiv zu gestalten und innere Zufriedenheit zu erreichen.</span></p><p></p><p></p><p></p><p></p><p></p>','yoga','pages/gq5zoE2LP3d4AskhkN4v5ZIgvoOhN6drg0rv5RNt.jpeg',NULL,'2019-06-21 13:35:03','2025-02-07 15:13:46'),(4,'Unterricht','<p></p><p></p><p></p><h1><span style=\"&quot;color:;\">Mein Yoga Unterricht</span></h1><p><span style=\"&quot;color:;\">Im Gruppenunterricht gehe ich neben der Praxis auf die Yogaphilosophie ein und vermittle damit Inhalt und Ziel in der Yogastunde. Zentrale Themen sind Patanjali Yoga Sutra (Achtfache Pfad), Hatha Yoga Pratipika und Bhakti Yoga. In meinem Yogaunterricht möchte ich alle Menschen ansprechen: Mit oder ohne Yoga-Erfahrung, auch das Alter spielt keine Rolle. In meinem Yogaunterricht achte ich besonders darauf, dass Jeder seinen individuellen Weg, seinen Bedürfnissen und Fähigkeiten folgen kann, ohne Anforderungsprofile. Auch nehme ich in meiner Yogapraxis auf die heutigen körperlichen Verhältnisse Rücksicht und gestalte meinen Unterricht zeitgerecht. Dazu ist jeder Teilnehmer aufgefordert, seine Fähigkeiten kennenzulernen und zu nutzen, Grenzen zu respektieren und dadurch im Einklang mit seinem Körper, der Seele und dem Geist Fortschritte zu erzielen. Der Unterricht ist in: Einklang- Aufwärmen- Asana (Praxis), Pranayama (Atemübungen- Achtsamkeitsübungen) und Ausklang (Meditationsübungen, Yoga-Nidra) gestaltet.</span></p><h1><span style=\"&quot;color:;\">Schwangerschaftsyoga</span></h1><p><span style=\"&quot;color:;\">Im Schwangerschaftsyoga beziehe ich mich auch auf das Hatha- Yoga. Die Übungen sind speziell sanfte Asana für Schwangere zur Förderung der Wahrnehmungs-Bewegungs- und Entspannungsfähigkeit. Es werden auch Atemübungen unterrichtet, speziell die Bauchatmung und das Tönen zur Begleitung der Wehen. Entspannungsübungen, Visualisierungen und Meditationen runden den Unterricht ab.</span></p><h1><span style=\"&quot;color:;\">Beckenboden- und Rueckbildungsyoga</span></h1><p><span style=\"&quot;color:;\">Im Beckenboden und Rückbildungsyoga nach der Schwangerschaft, vermittle ich anatomische Kenntnisse des Beckenbodens. Es werden Übungen, Asana zur Wiederherstellung der Wahrnehmungsfähigkeit, Beweglichkeit und Haltefähigkeit des Beckenbodens vermittelt. Wir lernen im Alltag unseren Beckenboden bewusst zu schonen; Bei Druckerhöhung, Belastung, Ernährung etc.</span><br><span style=\"&quot;color:;\">Im Unterricht werden Asana zur Anregung von Stoffwechsel und Kreislauf erlernt und Asana für die Mobilität, Kraft, Körperstatik und für das Gleichgewicht geübt</span>.</p><h1><span style=\"&quot;color:;\">Svastha Yoga Therapie</span></h1><p><span style=\"&quot;color:;\">Das Svastha Yoga Therapie Programm ist aufbauend auf den Lehren Krishnamacharya und beinhaltet die Essenz aus dem traditionellen Yoga und Ayurveda, verbunden mit der modernen Medizin. Meine erlernten Kenntnisse führen mich über das Bewegungssystem, sowie Anatomie der Atmung, zu den Atemwegs- und Herzkreislauferkrankungen und neurologische- und immunologische Erkrankungen, sowie seelische und psychische Probleme. Svastha Yoga ermöglicht aus einer ganzheitlichen Pespektive den Prozess des Gesundwerdens anzugehen. Unter Anwendung von Körperübungen und Atemtechniken, sowie auch Meditationen und Philosophischer Aspekte helfen den Betroffenen wieder ins Gleichgewicht zu finden. Das therapeutische Yoga ergänzt und erweitert das Spektrum der Behandlung und die Komponente der Selbstwirksamkeit, mit der, der/ die PatientIn aktiv teilhaben und mitgestalten kann. Weiter wird dem Patient/ der Patientin durch die Meditation der innere Zugang zu sich selber wieder eröffnet. Die Selbstheilungskräfte werden aktiviert, dadurch wird das Urvertrauen aufgebaut und der Zugang zum Lebenslicht wird möglich.</span></p><p></p><p></p><p></p>','unterricht','pages/icSRdKahvD636u97bBPI3Nwgxx9VGBdaZTjsKIsL.jpeg',NULL,'2019-06-21 13:35:03','2025-02-07 15:15:06'),(5,'Angebot','<p></p><p></p><h3>Angebot</h3><p><strong>Yoga Emmental</strong> ist umgezogen an die<br><strong>Kreuzstrasse 20, 3550 Langnau</strong> in der BWO-Heilpädagogischen Schule.</p><p></p><h4>Allgemeiner Gruppenunterricht</h4><p><strong>Hatha-Yoga</strong><br><strong>Am Mittwoch:</strong></p><ul><li><p><strong>Erste Lektion:</strong> 18:25 - 19:40</p></li><li><p><strong>Zweite Lektion:</strong> 19:50 - 21:05</p></li></ul><p><strong>Rückbildungsyoga, Schwangerschaftsyoga, und Hormonyoga</strong><br>auf Anfrage.</p><p></p><h4>Yogatherapie und Einzelstunde</h4><p>Nach Absprache.</p><p></p><p><strong>Anmeldung erwünscht</strong> – der Eintritt ist laufend möglich, auch für Anfänger.</p><p>Weitere Informationen und Anmeldung:</p><ul><li><p><strong>Telefon:</strong> 034 496 53 07</p></li><li><p><strong>Mobil:</strong> 079 644 02 64</p></li><li><p><strong>Email:</strong> <a href=\"mailto:info@sothegra.ch\">info@sothegra.ch</a></p><p></p></li></ul><h3>Zahlungsmodus:</h3><ul><li><p>Preis pro Lektion im Gruppenunterricht: <strong>Fr. 25.00 / Fr. 20.00 i.A.</strong></p></li><li><p>8 Lektionen werden im Voraus bezahlt und auf einem Coupon abgekreuzt. Uneingelöste Stunden verfallen nach vier Monaten.</p></li><li><p><strong>Schnupperstunde gratis.</strong></p></li></ul><p><strong>Therapieunterricht, Einzelunterricht nach Absprache:</strong></p><ul><li><p>60 Min à <strong>Fr. 95.00</strong></p></li><li><p>Jede weitere Minute <strong>Fr. 1.00</strong></p><p></p></li></ul><p></p>','angebot','pages/2XczalHWmBuVmVyjgtt1tybI7lnnDjtdzacCRAUc.jpeg',NULL,'2019-06-21 13:35:03','2025-02-07 15:17:09'),(6,'Kontakt',NULL,'kontakt','pages/JK7R7LeDBLpBrbWTZ5iyITHNfoahkdx7dJTteDyv.jpeg','contact','2019-06-21 13:35:03','2021-07-06 14:14:07');
